import React, { Component } from 'react'

export default class Test extends Component {

    constructor(props){
        super(props)
        this.state = {
            count : 0
        };
    }
    
    Increement=()=> {
        this.state({count:this.state.count+1})
    }
  render() {
    return (
      <div>

        <h2>{this.state.count}</h2>
        <button onClick={Increement}>Increement</button>
        
      </div>
    )
  }
}
